INSERT INTO `products_deposit` VALUES (1,'WR0001B','202411','우리은행','WON플러스예금','만기 후\n- 1개월이내 : 만기시점약정이율×50%\n- 1개월초과 6개월이내: 만기시점약정이율×30%\n- 6개월초과 : 만기시점약정이율×20%\n\n※ 만기시점 약정이율 : 일반정기예금 금리','인터넷,스마트폰,전화(텔레뱅킹)','해당사항 없음','1','실명의 개인'),(2,'00320342','202411','한국스탠다드차타드은행','e-그린세이브예금','만기 후 1개월: 약정이율의 50%\n만기 후 1개월 초과 1년 이내: 약정이율의 30%\n만기 후 1년 초과: 약정이율의 10%','인터넷,스마트폰','1.SC제일은행 최초 거래 신규고객에 대하여 우대 이율을 제공함 (보너스이율0.2%)                     2.SC제일마이백통장에서 출금하여 이 예금을 신규하는경우에 보너스이율을 제공함\n(가입기간:1년제/ 보너스이율:0.1% / 만기해약하는 경우에 한해 보너스이율을 적용함)','1','개인(개인사업자 포함)'),(3,'10511008000996000','202411','아이엠뱅크','iM주거래우대예금(첫만남고객형)','만기 후 1개월 미만 경과 : 약정이자율 x 50%\n만기 후 3개월 미만 경과 : 약정이자율 x 25% \n만기 후 3개월 이상 경과 : 약정이자율 x 10%','영업점,인터넷,스마트폰','* 최고우대금리 : 연0.65%p              \n - 목돈굴리기예금 최초 가입시 : 연0.20%p\n - 상품 가입 전 최근 1개월 이내 신용(체크)카드 신규 발급 : 연0.20%p\n - 상품 가입 전 최근 1개월 이내 인터넷.폰.모바일앱뱅킹 가입 : 연0.20%p\n * 해당 상품을 인터넷/모바일뱅킹을 통해 가입 : 연0.05%p','1','실명의 개인'),(4,'10511008001004000','202411','아이엠뱅크','iM행복파트너예금(일반형)','만기 후 1개월 미만 경과 : 약정이자율 x 50%\n만기 후 3개월 미만 경과 : 약정이자율 x 25% \n만기 후 3개월 이상 경과 : 약정이자율 x 10%','영업점,인터넷,스마트폰','* 최고우대금리 : 연0.45%p\n- 지난달 당행 통장으로 연금 입금 실적 보유 : 연0.10%p\n- 상품 가입 전 당행 신용(체크)카드 보유 : 연0.10%p\n- 지난 3개월 예금 평잔 30만원 이상 : 연0.10%p\n- iM행복파트너적금 동시 가입 및 만기 보유 : 연0.10%p\n* 해당 상품을 인터넷/모바일뱅킹을 통해 가입 : 연0.05%p','3','만50세 이상 실명의 개인'),(5,'10511008001166004','202411','아이엠뱅크','iM함께예금','만기 후 1개월 미만 경과 : 약정이자율 x 50%\n만기 후 3개월 미만 경과 : 약정이자율 x 25% \n만기 후 3개월 이상 경과 : 약정이자율 x 10%','영업점,인터넷,스마트폰','*최고우대금리: 연0.45%p\n-전월 총 수신 평잔실적 또는 상품 가입 전 첫만남플러스 통장 보유시 \n-당행 주택청약상품보유 \n-신규일 \"iM함께적금\" 동시 가입 및 만기 보유 \n-당행 오픈뱅킹서비스에 다른 은행 계좌 등록시 \n각 연0.10%p                       \n*해당 상품을 인터넷/모바일뱅킹을 통해 가입 시: 연0.05%p','1','실명의 개인 및 개인사업자'),(6,'10511008001278000','202411','아이엠뱅크','iM스마트예금','만기 후 1개월 미만 경과 : 약정이자율 x 50%\n만기 후 3개월 미만 경과 : 약정이자율 x 25% \n만기 후 3개월 이상 경과 : 약정이자율 x 10%','인터넷,스마트폰','* 최고우대금리 : 연0.25%p\n- 가입일(재예치일)로부터 3개월 이내 아래 1가지 이상 요건 충족시\n① 당행 주택청약종합저축 보유\n② 당행 신용(체크)카드 결제실적 보유(결제금액 출금기준)\n* 해당 상품을 인터넷/모바일뱅킹을 통해 가입 : 연0.